import "./styles/App.css";

function App() {
  return (
    <Router>
      <Header />
      <Switch>
        <Route path="/" exact component={HomePage} />
        <Route path="/journey/:id" component={JourneyPage} />
        <Route path="/create" component={CreateJourneyPage} />
        <Route path="/profile" component={ProfilePage} />
      </Switch>
      <Footer />
    </Router>
  );
}

export default App;
